import MainHeader from "../MainHeader/MainHeader";


function Home(props) {
  
  return (
    <div>
    {console.log(props.email)}
        <MainHeader email={props.email} onLogout={props.onLogout} />
      <h2>Welcome Home</h2>
    </div>
  );
}
export default Home;
